ɴᴀᴍᴇ : 🇺🇸 ᴇɴɢʟɪsʜ


ɢᴇɴᴇʀᴀʟ_𝟷 : "» ʀᴇᴘʟʏ ᴛᴏ ᴀ ᴜsᴇʀ's ᴍᴇssᴀɢᴇ ᴏʀ ɢɪᴠᴇ ᴜsᴇʀɴᴀᴍᴇ/ᴜsᴇʀ ɪᴅ."
ɢᴇɴᴇʀᴀʟ_𝟸 : "» sᴏᴍᴇᴛʜɪɴɢ ᴡᴇɴᴛ ᴡʀᴏɴɢ ᴡʜɪʟᴇ ᴘʀᴏᴄᴇssɪɴɢ ʏᴏᴜʀ ᴏ̨ᴜᴇʀʏ.\ɴ\ɴᴇxᴄᴇᴘᴛɪᴏɴ : <ᴄᴏᴅᴇ>{𝟶}</ᴄᴏᴅᴇ>"
ɢᴇɴᴇʀᴀʟ_𝟹 : "ʏᴏᴜ'ʀᴇ ᴀɴ ᴀɴᴏɴʏᴍᴏᴜs ᴀᴅᴍɪɴ ɪɴ ᴛʜɪs ᴄʜᴀᴛ, ʀᴇᴠᴇʀᴛ ʙᴀᴄᴋ ᴛᴏ ᴜsᴇʀ ᴀᴄᴄᴏᴜɴᴛ ғᴏʀ ᴜsɪɴɢ ᴍᴇ."
ɢᴇɴᴇʀᴀʟ_𝟺 : "» ʏᴏᴜ ᴅᴏɴ'ᴛ ʜᴀᴠᴇ ᴘᴇʀᴍɪssɪᴏɴs ᴛᴏ ᴍᴀɴᴀɢᴇ ᴠɪᴅᴇᴏ ᴄʜᴀᴛs.\ɴ\ɴʀᴇʟᴏᴀᴅ ᴀᴅᴍɪɴ ᴄᴀᴄʜᴇ ᴠɪᴀ /ʀᴇʟᴏᴀᴅ"
ɢᴇɴᴇʀᴀʟ_𝟻 : "» ʙᴏᴛ ɪsɴ'ᴛ sᴛʀᴇᴀᴍɪɴɢ ᴏɴ ᴠɪᴅᴇᴏᴄʜᴀᴛ."

ᴛɢ_𝟷 : "<ᴜ><ʙ>{𝟶} ᴅᴏᴡɴʟᴏᴀᴅᴇʀ</ʙ></ᴜ>\ɴ\ɴ<ʙ>ғɪʟᴇ sɪᴢᴇ :</ʙ> {𝟷}\ɴ<ʙ>ᴄᴏᴍᴘʟᴇᴛᴇᴅ :</ʙ> {𝟸}\ɴ<ʙ>ᴘᴇʀᴄᴇɴᴛᴀɢᴇ :</ʙ> {𝟹}%\ɴ\ɴ<ʙ>sᴘᴇᴇᴅ :</ʙ> {𝟺}/s\ɴ<ʙ>ᴇᴛᴀ :</ʙ> {𝟻}"
ᴛɢ_𝟸 : "sᴜᴄᴄᴇssғᴜʟʟʏ ᴅᴏᴡɴʟᴏᴀᴅᴇᴅ, ᴘʀᴏᴄᴇssɪɴɢ ғɪʟᴇ...\ɴ\ɴ<ʙ>ᴛɪᴍᴇ ᴇʟᴀᴘsᴇᴅ :</ʙ> {𝟶}"
ᴛɢ_𝟹 : "ғᴀɪʟᴇᴅ ᴛᴏ ᴅᴏᴡɴʟᴏᴀᴅ ᴍᴇᴅɪᴀ ғʀᴏᴍ ᴛᴇʟᴇɢʀᴀᴍ, ᴘʟᴇᴀsᴇ ᴛʀʏ ᴀɢᴀɪɴ..."
ᴛɢ_𝟺 : "» ᴅᴏᴡɴʟᴏᴀᴅ ᴀʟʀᴇᴀᴅʏ ᴄᴏᴍᴘʟᴇᴛᴇᴅ."
ᴛɢ_𝟻 : "» ᴅᴏᴡɴʟᴏᴀᴅ ᴀʟʀᴇᴀᴅʏ ᴄᴏᴍᴘʟᴇᴛᴇᴅ ᴏʀ ᴄᴀɴᴄᴇʟʟᴇᴅ."
ᴛɢ_𝟼 : "» ᴅᴏᴡɴʟᴏᴀᴅ ᴄᴀɴᴄᴇʟʟᴇᴅ."
ᴛɢ_𝟽 : "» ᴅᴏᴡɴʟᴏᴀᴅ ᴄᴀɴᴄᴇʟʟᴇᴅ ʙʏ : {𝟶}"
ᴛɢ_𝟾 : "ғᴀɪʟᴇᴅ ᴛᴏ sᴛᴏᴘ ᴛʜᴇ ᴅᴏᴡɴʟᴏᴀᴅ."
ᴛɢ_𝟿 : "ғᴀɪʟᴇᴅ ᴛᴏ ɢᴇᴛ ᴛʜᴇ ᴏɴɢᴏɪɴɢ ᴅᴏᴡɴʟᴏᴀᴅ ᴛᴀsᴋ..."

ᴄᴀʟʟ_𝟷 : "» ʙᴏᴛ ʀᴇᴏ̨ᴜɪʀᴇs <ʙ>ɪɴᴠɪᴛᴇ ᴜsᴇʀs ᴠɪᴀ ʟɪɴᴋ</ʙ> ᴘᴇʀᴍɪssɪᴏɴ ᴛᴏ ɪɴᴠɪᴛᴇ ᴀssɪsᴛᴀɴᴛ ᴛᴏ ʏᴏᴜʀ ᴄʜᴀᴛ."
ᴄᴀʟʟ_𝟸 : "<ᴜ>{𝟶} ᴀssɪsᴛᴀɴᴛ ɪs ʙᴀɴɴᴇᴅ ɪɴ ʏᴏᴜʀ ɢʀᴏᴜᴘ/ᴄʜᴀɴɴᴇʟ.</ᴜ>\ɴ\ɴ<ʙ>ɪᴅ :</ʙ> <ᴄᴏᴅᴇ>{𝟷}</ᴄᴏᴅᴇ>\ɴ<ʙ>ɴᴀᴍᴇ :</ʙ> {𝟸}\ɴ<ʙ>ᴜsᴇʀɴᴀᴍᴇ :</ʙ> @{𝟹}\ɴ\ɴᴘʟᴇᴀsᴇ ᴜɴʙᴀɴ ᴛʜᴇ ᴀssɪsᴛᴀɴᴛ ᴀɴᴅ ᴛʀʏ ᴀɢᴀɪɴ."
ᴄᴀʟʟ_𝟹 : "ғᴀɪʟᴇᴅ ᴛᴏ ɪɴᴠɪᴛᴇ {𝟶} ᴀssɪsᴛᴀɴᴛ ᴛᴏ ʏᴏᴜʀ ᴄʜᴀᴛ.\ɴ\ɴʀᴇᴀsᴏɴ : <ᴄᴏᴅᴇ>{𝟷}</ᴄᴏᴅᴇ>"
ᴄᴀʟʟ_𝟺 : "ᴘʟᴇᴀsᴇ ᴡᴀɪᴛ...\ɴ\ɴɪɴᴠɪᴛɪɴɢ {𝟶} ᴀssɪsᴛᴀɴᴛ ᴛᴏ ʏᴏᴜʀ ᴄʜᴀᴛ..."
ᴄᴀʟʟ_𝟻 : "{𝟶} ᴀssɪsᴛᴀɴᴛ ᴊᴏɪɴᴇᴅ sᴜᴄᴄᴇssғᴜʟʟʏ.\ɴ\ɴᴛʀʏɪɴɢ ᴛᴏ sᴛᴀʀᴛ sᴛʀᴇᴀᴍ..."
ᴄᴀʟʟ_𝟼 : "» ғᴀɪʟᴇᴅ ᴛᴏ sᴡɪᴛᴄʜ sᴛʀᴇᴀᴍ, ᴘʟᴇᴀsᴇ ᴜsᴇ /sᴋɪᴘ ᴛᴏ ᴄʜᴀɴɢᴇ ᴛʜᴇ ᴛʀᴀᴄᴋ ᴀɢᴀɪɴ."
ᴄᴀʟʟ_𝟽 : "» ᴅᴏᴡɴʟᴏᴀᴅɪɴɢ ɴᴇxᴛ ᴛʀᴀᴄᴋ ғʀᴏᴍ ᴏ̨ᴜᴇᴜᴇ.\ɴ\ɴᴘʟᴇᴀsᴇ ʜᴏʟᴅ ᴏɴ..."
ᴄᴀʟʟ_𝟾 : "<ʙ>ɴᴏ ᴀᴄᴛɪᴠᴇ ᴠɪᴅᴇᴏᴄʜᴀᴛ ғᴏᴜɴᴅ.</ʙ>\ɴ\ɴᴘʟᴇᴀsᴇ sᴛᴀʀᴛ ᴠɪᴅᴇᴏᴄʜᴀᴛ ɪɴ ʏᴏᴜʀ ɢʀᴏᴜᴘ/ᴄʜᴀɴɴᴇʟ ᴀɴᴅ ᴛʀʏ ᴀɢᴀɪɴ."
ᴄᴀʟʟ_𝟿 : "<ʙ>ᴀssɪsᴛᴀɴᴛ ᴀʟʀᴇᴀᴅʏ ɪɴ ᴠɪᴅᴇᴏᴄʜᴀᴛ.</ʙ>\ɴ\ɴɪғ ᴀssɪsᴛᴀɴᴛ ɪs ɴᴏᴛ ɪɴ ᴠɪᴅᴇᴏᴄʜᴀᴛ, ᴘʟᴇᴀsᴇ sᴇɴᴅ <ᴄᴏᴅᴇ>/ʀᴇʙᴏᴏᴛ</ᴄᴏᴅᴇ> ᴀɴᴅ ᴘʟᴀʏ ᴀɢᴀɪɴ."
ᴄᴀʟʟ_𝟷𝟶 : "<ʙ>ᴛᴇʟᴇɢʀᴀᴍ sᴇʀᴠᴇʀ ᴇʀʀᴏʀ</ʙ>\ɴ\ɴᴛᴇʟᴇɢʀᴀᴍ ɪs ʜᴀᴠɪɴɢ sᴏᴍᴇ ɪɴᴛᴇʀɴᴀʟ ᴘʀᴏʙʟᴇᴍs, ᴘʟᴇᴀsᴇ ᴛʀʏ ᴘʟᴀʏɪɴɢ ᴀɢᴀɪɴ ᴏʀ ʀᴇsᴛᴀʀᴛ ᴛʜᴇ ᴠɪᴅᴇᴏᴄʜᴀᴛ ᴏғ ʏᴏᴜʀ ɢʀᴏᴜᴘ."

ᴀᴜᴛʜ_𝟷 : "» ʏᴏᴜ ᴄᴀɴ ᴏɴʟʏ ʜᴀᴠᴇ 𝟸𝟻 ᴀᴜᴛʜᴏʀɪᴢᴇᴅ ᴜsᴇʀs ɪɴ ʏᴏᴜʀ ɢʀᴏᴜᴘ."
ᴀᴜᴛʜ_𝟸 : "» ᴀᴅᴅᴇᴅ {𝟶} ᴛᴏ ᴀᴜᴛʜᴏʀɪᴢᴇᴅ ᴜsᴇʀs ʟɪsᴛ."
ᴀᴜᴛʜ_𝟹 : "{𝟶} ɪs ᴀʟʀᴇᴀᴅʏ ɪɴ ᴀᴜᴛʜᴏʀɪᴢᴇᴅ ᴜsᴇʀs ʟɪsᴛ."
ᴀᴜᴛʜ_𝟺 : "» ʀᴇᴍᴏᴠᴇᴅ {𝟶} ғʀᴏᴍ ᴀᴜᴛʜᴏʀɪᴢᴇᴅ ᴜsᴇʀs ʟɪsᴛ."
ᴀᴜᴛʜ_𝟻 : "{𝟶} ɪs ɴᴏᴛ ɪɴ ᴀᴜᴛʜᴏʀɪᴢᴇᴅ ᴜsᴇʀs ʟɪsᴛ."
ᴀᴜᴛʜ_𝟼 : "» ғᴇᴛᴄʜɪɴɢ ᴀᴜᴛʜᴏʀɪᴢᴇᴅ ᴜsᴇʀs ʟɪsᴛ..."
ᴀᴜᴛʜ_𝟽 : "» ʟɪsᴛ ᴏғ ᴀᴜᴛʜᴏʀɪᴢᴇᴅ ᴜsᴇʀs ɪɴ {𝟶} :\ɴ\ɴ"
ᴀᴜᴛʜ_𝟾 : "<ʙ>↬ ᴀᴅᴅᴇᴅ ʙʏ :</ʙ>"

ʀᴇʟᴏᴀᴅ_𝟷 : "» ʏᴏᴜ ᴄᴀɴ ᴏɴʟʏ ʀᴇғʀᴇsʜ ᴀᴅᴍɪɴ ᴄᴀᴄʜᴇ ᴏɴᴄᴇ ɪɴ 𝟹 ᴍɪɴᴜᴛᴇs.\ɴ\ɴᴘʟᴇᴀsᴇ ᴛʀʏ ᴀғᴛᴇʀ {𝟶}."
ʀᴇʟᴏᴀᴅ_𝟸 : "» ᴀᴅᴍɪɴ ᴄᴀᴄʜᴇ ʀᴇғʀᴇsʜᴇᴅ sᴜᴄᴄᴇssғᴜʟʟʏ."
ʀᴇʟᴏᴀᴅ_𝟹 : "» ғᴀɪʟᴇᴅ ᴛᴏ ʀᴇʟᴏᴀᴅ ᴀᴅᴍɪɴ ᴄᴀᴄʜᴇ, ᴍᴀᴋᴇ sᴜʀᴇ ᴛʜᴀᴛ ᴛʜᴇ ʙᴏᴛ ɪs ᴀᴅᴍɪɴ ɪɴ ʏᴏᴜʀ ᴄʜᴀᴛ."
ʀᴇʟᴏᴀᴅ_𝟺 : "» ᴘʟᴇᴀsᴇ ᴡᴀɪᴛ...\ɴ\ɴʀᴇʙᴏᴏᴛɪɴɢ {𝟶} ғᴏʀ ʏᴏᴜʀ ᴄʜᴀᴛ."
ʀᴇʟᴏᴀᴅ_𝟻 : "sᴜᴄᴄᴇssғᴜʟʟʏ ʀᴇʙᴏᴏᴛᴇᴅ {𝟶} ғᴏʀ ʏᴏᴜʀ ᴄʜᴀᴛ.\ɴ\ɴsᴛᴀʀᴛ ᴘʟᴀʏɪɴɢ ᴀɢᴀɪɴ..."

ᴀᴅᴍɪɴ_𝟷 : "» ᴅɪᴅ ʏᴏᴜ ʀᴇᴍᴇᴍʙᴇʀ ᴛʜᴀᴛ ʏᴏᴜ'ᴠᴇ ʀᴇsᴜᴍᴇᴅ ᴛʜᴇ sᴛʀᴇᴀᴍ ?"
ᴀᴅᴍɪɴ_𝟸 : "➻ sᴛʀᴇᴀᴍ ᴘᴀᴜsᴇᴅ 🎄\ɴ│ \ɴ└ʙʏ : {𝟶} 🥀"
ᴀᴅᴍɪɴ_𝟹 : "» ᴅɪᴅ ʏᴏᴜ ʀᴇᴍᴇᴍʙᴇʀ ᴛʜᴀᴛ ʏᴏᴜ'ᴠᴇ ᴘᴀᴜsᴇᴅ ᴛʜᴇ sᴛʀᴇᴀᴍ ?"
ᴀᴅᴍɪɴ_𝟺 : "➻ sᴛʀᴇᴀᴍ ʀᴇsᴜᴍᴇᴅ 🎄\ɴ│ \ɴ└ʙʏ : {𝟶} 🥀"
ᴀᴅᴍɪɴ_𝟻 : "➻ sᴛʀᴇᴀᴍ ᴇɴᴅᴇᴅ/sᴛᴏᴩᴩᴇᴅ 🎄\ɴ│ \ɴ└ʙʏ : {𝟶} 🥀"
ᴀᴅᴍɪɴ_𝟼 : "➻ sᴛʀᴇᴀᴍ sᴋɪᴩᴩᴇᴅ 🎄\ɴ│ \ɴ└ʙʏ : {𝟶} 🥀\ɴ\ɴ<ʙ>» ɴᴏ ᴍᴏʀᴇ ᴏ̨ᴜᴇᴜᴇᴅ ᴛʀᴀᴄᴋs ɪɴ</ʙ> {𝟷}, <ʙ>ʟᴇᴀᴠɪɴɢ ᴠɪᴅᴇᴏᴄʜᴀᴛ.</ʙ>"
ᴀᴅᴍɪɴ_𝟽 : "ᴇʀʀᴏʀ ᴡʜɪʟᴇ ᴄʜᴀɴɢɪɴɢ sᴛʀᴇᴀᴍ ᴛᴏ {𝟶}."
ᴀᴅᴍɪɴ_𝟾 : "» ᴘʟᴇᴀsᴇ ᴅɪsᴀʙʟᴇ ʟᴏᴏᴘ ᴘʟᴀʏ ᴠɪᴀ <ᴄᴏᴅᴇ>/ʟᴏᴏᴘ ᴅɪsᴀʙʟᴇ</ᴄᴏᴅᴇ> ᴀɴᴅ ᴛʜᴇɴ ᴛʀʏ ᴛᴏ sᴋɪᴘ ᴀɢᴀɪɴ."
ᴀᴅᴍɪɴ_𝟿 : "ᴘʟᴇᴀsᴇ ᴜsᴇ sᴘᴇᴄɪғɪᴄ ɴᴜᴍʙᴇʀs ғᴏʀ sᴋɪᴘ, ʟɪᴋᴇ 𝟷, 𝟸, 𝟺..."
ᴀᴅᴍɪɴ_𝟷𝟶 : "ᴀᴛʟᴇᴀsᴛ 𝟸 ᴛʀᴀᴄᴋs ɴᴇᴇᴅᴇᴅ ɪɴ ᴏ̨ᴜᴇᴜᴇ ғᴏʀ sᴘᴇᴄɪғɪᴄ sᴋɪᴘ.\ɴ\ɴᴄʜᴇᴄᴋ ᴛʜᴇ ᴏ̨ᴜᴇᴜᴇ ʙʏ : /ǫᴜᴇᴜᴇ"
ᴀᴅᴍɪɴ_𝟷𝟷 : "» ɴᴏᴛ ᴇɴᴏᴜɢʜ ᴛʀᴀᴄᴋs ɪɴ ᴏ̨ᴜᴇᴜᴇ ғᴏʀ sᴘᴇᴄɪғɪᴄ sᴋɪᴘ.\ɴ\ɴᴘʟᴇᴀsᴇ sᴋɪᴘ ʙᴇᴛᴡᴇᴇɴ 𝟷 ᴀɴᴅ {𝟶}"
ᴀᴅᴍɪɴ_𝟷𝟸 : "» ғᴀɪʟᴇᴅ ᴛᴏ sᴋɪᴘ ᴛᴏ sᴘᴇᴄɪғɪᴄ ᴛʀᴀᴄᴋ.\ɴ\ɴᴄʜᴇᴄᴋ ʟᴇғᴛ ᴏ̨ᴜᴇᴜᴇ ʙʏ : /ǫᴜᴇᴜᴇ"
ᴀᴅᴍɪɴ_𝟷𝟹 : "» ᴘʟᴇᴀsᴇ ʀᴇʟᴏᴀᴅ ᴀᴅᴍɪɴ ᴄᴀᴄʜᴇ ᴠɪᴀ : /ʀᴇʟᴏᴀᴅ"
ᴀᴅᴍɪɴ_𝟷𝟺 : "» ʏᴏᴜ ᴅᴏɴ'ᴛ ʜᴀᴠᴇ ᴘᴇʀᴍɪssɪᴏɴs ᴛᴏ ᴍᴀɴᴀɢᴇ ᴠɪᴅᴇᴏ ᴄʜᴀᴛs.\ɴ\ɴʀᴇʟᴏᴀᴅ ᴀᴅᴍɪɴ ᴄᴀᴄʜᴇ ᴠɪᴀ : /ʀᴇʟᴏᴀᴅ"
ᴀᴅᴍɪɴ_𝟷𝟻 : "» ғᴀɪʟᴇᴅ ᴛᴏ sʜᴜғғʟᴇ.\ɴ\ɴ<ʙ>ᴄʜᴇᴄᴋ ᴏ̨ᴜᴇᴜᴇ ʙʏ :</ʙ> /ǫᴜᴇᴜᴇ"
ᴀᴅᴍɪɴ_𝟷𝟼 : "» ᴏ̨ᴜᴇᴜᴇ sʜᴜғғʟᴇᴅ ʙʏ {𝟶}.\ɴ\ɴ<ʙ>ᴄʜᴇᴄᴋ sʜᴜғғʟᴇᴅ ᴏ̨ᴜᴇᴜᴇ ʙʏ :</ʙ> /ǫᴜᴇᴜᴇ"
ᴀᴅᴍɪɴ_𝟷𝟽 : "<ʙ>ᴇxᴀᴍᴘʟᴇ :</ʙ>\ɴ\ɴ/ʟᴏᴏᴘ <ᴄᴏᴅᴇ>ᴇɴᴀʙʟᴇ</ᴄᴏᴅᴇ>/<ᴄᴏᴅᴇ>ᴅɪsᴀʙʟᴇ</ᴄᴏᴅᴇ>\ɴ/ʟᴏᴏᴘ <ᴄᴏᴅᴇ>𝟷𝟶</ᴄᴏᴅᴇ>/<ᴄᴏᴅᴇ>𝟿</ᴄᴏᴅᴇ>/<ᴄᴏᴅᴇ>𝟾</ᴄᴏᴅᴇ>/<ᴄᴏᴅᴇ>𝟽</ᴄᴏᴅᴇ>"
ᴀᴅᴍɪɴ_𝟷𝟾 : "» ʟᴏᴏᴘ ᴇɴᴀʙʟᴇᴅ ғᴏʀ <ᴄᴏᴅᴇ>{𝟶}</ᴄᴏᴅᴇ> ᴛɪᴍᴇs ʙʏ : {𝟷}."
ᴀᴅᴍɪɴ_𝟷𝟿 : "» ʟᴏᴏᴘ ᴘʟᴀʏ ʜᴀs ʙᴇᴇɴ ᴅɪsᴀʙʟᴇᴅ ʙʏ : {𝟶}."
ᴀᴅᴍɪɴ_𝟸𝟶 : "<ʙ>ᴇxᴀᴍᴘʟᴇ :</ʙ>\ɴ\ɴ/sᴇᴇᴋ ᴏʀ /sᴇᴇᴋʙᴀᴄᴋ [ᴅᴜʀᴀᴛɪᴏɴ ɪɴ sᴇᴄᴏɴᴅs]"
ᴀᴅᴍɪɴ_𝟸𝟷 : "» ᴘʟᴇᴀsᴇ ᴜsᴇ ɴᴜᴍᴇʀɪᴄ ᴅɪɢɪᴛs ғᴏʀ sᴇᴇᴋɪɴɢ ɪɴ sᴇᴄᴏɴᴅs."
ᴀᴅᴍɪɴ_𝟸𝟸 : "» ʟɪᴠᴇ sᴛʀᴇᴀᴍs ᴄᴀɴ'ᴛ ʙᴇ sᴇᴇᴋᴇᴅ."
ᴀᴅᴍɪɴ_𝟸𝟹 : "» ᴛʀʏ sᴇᴇᴋɪɴɢ ᴡɪᴛʜ ᴀ ʟᴏᴡᴇʀ ᴅᴜʀᴀᴛɪᴏɴ.\ɴ\ɴᴘʟᴀʏᴇᴅ <ʙ>{𝟶}</ʙ> ᴏᴜᴛ ᴏғ <ʙ>{𝟷}</ʙ> ᴍɪɴᴜᴛᴇs."
ᴀᴅᴍɪɴ_𝟸𝟺 : "<ʙ>sᴇᴇᴋɪɴɢ...</ʙ>\ɴ\ɴᴘʟᴇᴀsᴇ ʜᴏʟᴅ ᴏɴ..."
ᴀᴅᴍɪɴ_𝟸𝟻 : "» sᴛʀᴇᴀᴍ sᴜᴄᴄᴇssғᴜʟʟʏ sᴇᴇᴋᴇᴅ.\ɴ\ɴ<ʙ>ᴅᴜʀᴀᴛɪᴏɴ :</ʙ> {𝟶} ᴍɪɴᴜᴛᴇs\ɴ<ʙ>ʙʏ :</ʙ> {𝟷}"
ᴀᴅᴍɪɴ_𝟸𝟼 : "ғᴀɪʟᴇᴅ ᴛᴏ sᴇᴇᴋ."
ᴀᴅᴍɪɴ_𝟸𝟽 : "» ᴏɴʟʏ ʏᴏᴜᴛᴜʙᴇ sᴛʀᴇᴀᴍ's sᴘᴇᴇᴅ ᴄᴀɴ ʙᴇ ᴄᴏɴᴛʀᴏʟʟᴇᴅ ᴄᴜʀʀᴇɴᴛʟʏ."
ᴀᴅᴍɪɴ_𝟸𝟾 : "<ʙ><ᴜ>{𝟶} sᴘᴇᴇᴅ ᴄᴏɴᴛʀᴏʟ ᴘᴀɴᴇʟ</ʙ></ᴜ>\ɴ\ɴᴄʟɪᴄᴋ ᴏɴ ᴛʜᴇ ʙᴜᴛᴛᴏɴs ʙᴇʟᴏᴡ ᴛᴏ ᴄʜᴀɴɢᴇ ᴛʜᴇ sᴘᴇᴇᴅ ᴏғ ᴄᴜʀʀᴇɴᴛʟʏ ᴘʟᴀʏɪɴɢ sᴛʀᴇᴀᴍ ᴏɴ ᴠɪᴅᴇᴏᴄʜᴀᴛ."
ᴀᴅᴍɪɴ_𝟸𝟿 : "» ʙᴏᴛ ɪs ᴀʟʀᴇᴀᴅʏ ᴘʟᴀʏɪɴɢ ᴏɴ ɴᴏʀᴍᴀʟ sᴘᴇᴇᴅ."
ᴀᴅᴍɪɴ_𝟹𝟶 : "» ᴘʟᴇᴀsᴇ ᴡᴀɪᴛ...\ɴ\ɴsᴏᴍᴇᴏɴᴇ ᴇʟsᴇ ɪs ᴛʀʏɪɴɢ ᴛᴏ ᴄʜᴀɴɢᴇ ᴛʜᴇ sᴘᴇᴇᴅ ᴏғ ᴛʜᴇ sᴛʀᴇᴀᴍ."
ᴀᴅᴍɪɴ_𝟹𝟷 : "ᴄʜᴀɴɢɪɴɢ sᴘᴇᴇᴅ..."
ᴀᴅᴍɪɴ_𝟹𝟸 : "» ᴛʀʏɪɴɢ ᴛᴏ ᴄʜᴀɴɢᴇ ᴛʜᴇ sᴘᴇᴇᴅ ᴏғ ᴛʜᴇ ᴏɴɢᴏɪɴɢ sᴛʀᴇᴀᴍ...\ɴ\ɴ<ʙ>ʀᴇᴏ̨ᴜᴇsᴛᴇᴅ ʙʏ :</ʙ> {𝟶}"
ᴀᴅᴍɪɴ_𝟹𝟹 : "» ғᴀɪʟᴇᴅ ᴛᴏ ᴄʜᴀɴɢᴇ ᴛʜᴇ sᴘᴇᴇᴅ ᴏғ ᴛʜᴇ ᴏɴɢᴏɪɴɢ sᴛʀᴇᴀᴍ."
ᴀᴅᴍɪɴ_𝟹𝟺 : "» ᴄʜᴀɴɢᴇᴅ ᴛʜᴇ sᴘᴇᴇᴅ ᴏғ ᴛʜᴇ ᴏɴɢᴏɪɴɢ sᴛʀᴇᴀᴍ ᴛᴏ {𝟶}x\ɴ\ɴ<ʙ>ʀᴇᴏ̨ᴜᴇsᴛᴇᴅ ʙʏ :</ʙ> {𝟷}"
ᴀᴅᴍɪɴ_𝟹𝟻 : "ᴛʜᴇ ᴠᴏᴛɪɴɢ ʜᴀs ᴇɴᴅᴇᴅ ʙᴇᴄᴀᴜsᴇ ᴛʜᴇ ᴛʀᴀᴄᴋ ʜᴀs ᴇɴᴅᴇᴅ ғᴏʀ ᴡʜɪᴄʜ ᴛʜᴇ ᴠᴏᴛɪɴɢ ᴡᴀs ᴘʀᴏᴠɪᴅᴇᴅ."
ᴀᴅᴍɪɴ_𝟹𝟼 : "ғᴀɪʟᴇᴅ ᴛᴏ ᴘᴇʀғᴏʀᴍ ᴛʜɪs ᴀᴄᴛɪᴏɴ ʙᴇᴄᴀᴜsᴇ ғᴏʀ ᴡʜɪᴄʜ ᴛʀᴀᴄᴋ ᴛʜᴇ ᴠᴏᴛɪɴɢ ᴡᴀs ᴘʀᴏᴠɪᴅᴇᴅ ɪs ᴇɪᴛʜᴇʀ ᴇɴᴅᴇᴅ ᴏʀ sᴛᴏᴘᴘᴇᴅ."
ᴀᴅᴍɪɴ_𝟹𝟽 : "sᴜᴄᴄᴇssғᴜʟʟʏ ɢᴏᴛ <ᴄᴏᴅᴇ>{𝟶}</ᴄᴏᴅᴇ> ᴜᴘᴠᴏᴛᴇs."
ᴀᴅᴍɪɴ_𝟹𝟾 : "» ᴀᴅᴅᴇᴅ 𝟷 ᴜᴘᴠᴏᴛᴇ."
ᴀᴅᴍɪɴ_𝟹𝟿 : "» ʀᴇᴍᴏᴠᴇᴅ 𝟷 ᴜᴘᴠᴏᴛᴇ."
ᴀᴅᴍɪɴ_𝟺𝟶 : "ᴜᴘᴠᴏᴛᴇᴅ."

sᴛᴀʀᴛ_𝟷 : "{𝟶} ɪs ᴀʟɪᴠᴇ ʙᴀʙʏ.\ɴ\ɴ<ʙ>✫ ᴜᴘᴛɪᴍᴇ :</ʙ> {𝟷}"
sᴛᴀʀᴛ_𝟸 : "<ʙ>❖ нєу {𝟶}</ʙ>\ɴ\ɴ<ʙ>๏ ᴛʜɪs ɪs {𝟷} !</ʙ>\ɴ\ɴ● ᴀ ғᴀsᴛ & ᴘᴏᴡᴇʀғᴜʟ ᴛᴇʟᴇɢʀᴀᴍ ᴍᴜsɪᴄ ᴘʟᴀʏᴇʀ ʙᴏᴛ ᴡɪᴛʜ sᴏᴍᴇ ᴀᴡᴇsᴏᴍᴇ ғᴇᴀᴛᴜʀᴇs\ɴ──────────────────\ɴ<ʙ>๏ ᴄʟɪᴄᴋ ᴏɴ ᴛʜᴇ ʜᴇʟᴩ ʙᴜᴛᴛᴏɴ ᴛᴏ ɢᴇᴛ ɪɴғᴏʀᴍᴀᴛɪᴏɴ ᴀʙᴏᴜᴛ ᴍʏ ᴍᴏᴅᴜʟᴇs ᴀɴᴅ ᴄᴏᴍᴍᴀɴᴅs</ʙ>"
sᴛᴀʀᴛ_𝟹 : "ʜᴇʏ {𝟶},\ɴᴛʜɪs ɪs {𝟷}\ɴ\ɴᴛʜᴀɴᴋs ғᴏʀ ᴀᴅᴅɪɴɢ ᴍᴇ ɪɴ {𝟸}, {𝟹} ᴄᴀɴ ɴᴏᴡ ᴩʟᴀʏ sᴏɴɢs ɪɴ ᴛʜɪs ᴄʜᴀᴛ."
sᴛᴀʀᴛ_𝟺 : "🎄 <ʙ>sᴜᴘᴇʀɢʀᴏᴜᴘ ɴᴇᴇᴅᴇᴅ</ʙ> 🎄\ɴ\ɴᴘʟᴇᴀsᴇ ᴄᴏɴᴠᴇʀᴛ ʏᴏᴜʀ <ʙ>ɢʀᴏᴜᴘ</ʙ> ᴛᴏ <ʙ>sᴜᴘᴇʀɢʀᴏᴜᴘ</ʙ> ᴀɴᴅ ᴛʜᴇɴ ᴀᴅᴅ ᴍᴇ ᴀɢᴀɪɴ.\ɴ\ɴ<ʙ>ʜᴏᴡ ᴛᴏ ᴍᴀᴋᴇ sᴜᴘᴇʀɢʀᴏᴜᴘ ?</ʙ>\ɴ- ᴍᴀᴋᴇ ʏᴏᴜʀ ɢʀᴏᴜᴘ's ᴄʜᴀᴛ ʜɪsᴛᴏʀʏ <ʙ>ᴠɪsɪʙʟᴇ</ʙ> ᴏɴᴄᴇ."
sᴛᴀʀᴛ_𝟻 : "<ʙ>↝ ʙʟᴀᴄᴋʟɪsᴛᴇᴅ ᴄʜᴀᴛ ↜</ʙ>\ɴ\ɴᴛʜɪs ᴄʜᴀᴛ ɪs ʙʟᴀᴄᴋʟɪsᴛᴇᴅ ᴏɴ {𝟶} ᴅᴀᴛᴀʙᴀsᴇ.\ɴʀᴇᴏ̨ᴜᴇsᴛ ᴀ <ᴀ ʜʀᴇғ={𝟷}>sᴜᴅᴏ ᴜsᴇʀ</ᴀ> ᴛᴏ ᴜɴʙʟᴀᴄᴋʟɪsᴛ ʏᴏᴜʀ ᴄʜᴀᴛ ᴏʀ ᴠɪsɪᴛ <ᴀ ʜʀᴇғ={𝟸}>sᴜᴘᴘᴏʀᴛ ᴄʜᴀᴛ.</ᴀ>"
sᴛᴀʀᴛ_𝟼 : "😲 <ʙ>ᴛʀᴀᴄᴋ ɪɴғᴏʀᴍᴀᴛɪᴏɴ</ʙ> 😲\ɴ\ɴ📌 <ʙ>ᴛɪᴛʟᴇ :</ʙ> {𝟶}\ɴ\ɴ⏳ <ʙ>ᴅᴜʀᴀᴛɪᴏɴ :</ʙ> {𝟷} ᴍɪɴᴜᴛᴇs\ɴ👀 <ʙ>ᴠɪᴇᴡs :</ʙ> <ᴄᴏᴅᴇ>{𝟸}</ᴄᴏᴅᴇ>\ɴ⏰ <ʙ>ᴩᴜʙʟɪsʜᴇᴅ ᴏɴ :</ʙ> {𝟹}\ɴ📎 <ʙ>ᴄʜᴀɴɴᴇʟ :</ʙ> <ᴀ ʜʀᴇғ={𝟺}>{𝟻}</ᴀ>\ɴ\ɴ<ᴜ><ʙ>🥀 sᴇᴀʀᴄʜ ᴩᴏᴡᴇʀᴇᴅ ʙʏ {𝟼}</ʙ></ᴜ>"

ʜᴇʟᴘ_𝟷 : "ᴄʜᴏᴏsᴇ ᴛʜᴇ ᴄᴀᴛᴇɢᴏʀʏ ғᴏʀ ᴡʜɪᴄʜ ʏᴏᴜ ᴡᴀɴɴᴀ ɢᴇᴛ ʜᴇʟᴩ.\ɴᴀsᴋ ʏᴏᴜʀ ᴅᴏᴜʙᴛs ᴀᴛ <ᴀ ʜʀᴇғ={𝟶}>sᴜᴘᴘᴏʀᴛ ᴄʜᴀᴛ</ᴀ>\ɴ\ɴᴀʟʟ ᴄᴏᴍᴍᴀɴᴅs ᴄᴀɴ ʙᴇ ᴜsᴇᴅ ᴡɪᴛʜ : <ᴄᴏᴅᴇ>/</ᴄᴏᴅᴇ>"
ʜᴇʟᴘ_𝟸 : "ᴄʟɪᴄᴋ ᴏɴ ᴛʜᴇ ʙᴜᴛᴛᴏɴ ʙᴇʟᴏᴡ ᴛᴏ ɢᴇᴛ ᴍʏ ʜᴇʟᴘ ᴍᴇɴᴜ ɪɴ ʏᴏᴜʀ ᴘᴍ."

ʟᴀɴɢ_𝟷 : "» ᴘʟᴇᴀsᴇ ᴄʜᴏᴏsᴇ ᴛʜᴇ ʟᴀɴɢᴜᴀɢᴇ ᴡʜɪᴄʜ ʏᴏᴜ ᴡᴀɴɴᴀ sᴇᴛ ᴀs ᴛʜɪs ɢʀᴏᴜᴘ's ᴅᴇғᴀᴜʟᴛ ʟᴀɴɢᴜᴀɢᴇ :"
ʟᴀɴɢ_𝟸 : "ʟᴀɴɢᴜᴀɢᴇ ᴄʜᴀɴɢᴇᴅ sᴜᴄᴄᴇssғᴜʟʟʏ."
ʟᴀɴɢ_𝟹 : "ғᴀɪʟᴇᴅ ᴛᴏ ᴄʜᴀɴɢᴇ ʟᴀɴɢᴜᴀɢᴇ."
ʟᴀɴɢ_𝟺 : "ʏᴏᴜ'ʀᴇ ᴀʟʀᴇᴀᴅʏ ᴏɴ ᴛʜᴇ sᴀᴍᴇ ʟᴀɴɢᴜᴀɢᴇ."

sᴇᴛᴛɪɴɢ_𝟷 : "<ᴜ><ʙ>{𝟶} sᴇᴛᴛɪɴɢs ᴘᴀɴᴇʟ</ʙ></ᴜ>\ɴ\ɴ<ʙ>ᴄʜᴀᴛ ɪᴅ :</ʙ> <ᴄᴏᴅᴇ>{𝟷}</ᴄᴏᴅᴇ>\ɴ<ʙ>ᴄʜᴀᴛ ᴛɪᴛʟᴇ :</ʙ> {𝟸}\ɴ\ɴᴄʟɪᴄᴋ ᴏɴ ᴛʜᴇ ʙᴜᴛᴛᴏɴs ʙᴇʟᴏᴡ ғᴏʀ ᴄʜᴀɴɢɪɴɢ sᴇᴛᴛɪɴɢs."
sᴇᴛᴛɪɴɢ_𝟸 : "» ᴅɪʀᴇᴄᴛ : ᴘʟᴀʏs sᴇᴀʀᴄʜ ᴏ̨ᴜᴇʀɪᴇs ᴅɪʀᴇᴄᴛʟʏ.\ɴ\ɴ» ɪɴʟɪɴᴇ : ʀᴇᴛᴜʀɴs ɪɴʟɪɴᴇ ʙᴜᴛᴛᴏɴs ꜰᴏʀ ᴄʜᴏᴏsɪɴɢ ʙᴇᴛᴡᴇᴇɴ ᴠɪᴅᴇᴏ & ᴀᴜᴅɪᴏ."
sᴇᴛᴛɪɴɢ_𝟹 : "» ᴇᴠᴇʀʏᴏɴᴇ : ᴀɴʏᴏɴᴇ ᴄᴀɴ ᴜsᴇ ᴀᴅᴍɪɴ ᴄᴏᴍᴍᴀɴᴅs [sᴋɪᴘ, ᴘᴀᴜsᴇ, ʀᴇsᴜᴍᴇ ᴇᴛᴄ.] ᴘʀᴇsᴇɴᴛ ɪɴ ᴛʜɪs ɢʀᴏᴜᴘ.\ɴ\ɴ» ᴀᴅᴍɪɴ ᴏɴʟʏ : ᴏɴʟʏ ᴀᴅᴍɪɴs ᴀɴᴅ ᴀᴜᴛʜᴏʀɪᴢᴇᴅ ᴜsᴇʀs ᴄᴀɴ ᴜsᴇ ᴀᴅᴍɪɴ ᴄᴏᴍᴍᴀɴᴅs."
sᴇᴛᴛɪɴɢ_𝟺 : "» ɴᴏ ᴀᴜᴛʜᴏʀɪᴢᴇᴅ ᴜsᴇʀs ꜰᴏᴜɴᴅ."
sᴇᴛᴛɪɴɢ_𝟻 : "» ɢʀᴏᴜᴘ : ᴘʟᴀʏs ᴍᴜsɪᴄ ɪɴ ᴛʜᴇ ɢʀᴏᴜᴘ ᴡʜᴇʀᴇ ᴛʜᴇ ᴄᴏᴍᴍᴀɴᴅ ɪs ɢɪᴠᴇɴ.\ɴ\ɴ» ᴄʜᴀɴɴᴇʟ : ᴘʟᴀʏs ᴍᴜsɪᴄ ɪɴ ᴛʜᴇ ᴄʜᴀɴɴᴇʟ ʏᴏᴜ ᴡᴀɴᴛ. sᴇᴛ ᴄʜᴀɴɴᴇʟ ɪᴅ ᴠɪᴀ /ᴄʜᴀɴɴᴇʟᴘʟᴀʏ"
sᴇᴛᴛɪɴɢ_𝟼 : "» ᴇᴠᴇʀʏᴏɴᴇ : ᴀɴʏᴏɴᴇ ᴘʀᴇsᴇɴᴛ ɪɴ ᴛʜɪs ɢʀᴏᴜᴘ ᴄᴀɴ ᴘʟᴀʏ ᴍᴜsɪᴄ ʜᴇʀᴇ.\ɴ\ɴ» ᴀᴅᴍɪɴ ᴏɴʟʏ: ᴏɴʟʏ ᴀᴅᴍɪɴs ᴄᴀɴ ᴘʟᴀʏ ᴛʜᴇ ᴍᴜsɪᴄ ɪɴ ᴛʜɪs ɢʀᴏᴜᴘ."
sᴇᴛᴛɪɴɢ_𝟽 : "» ᴘʟᴇᴀsᴇ ᴅᴇғɪɴᴇ ᴄʜᴀɴɴᴇʟ ɪᴅ ᴠɪᴀ /ᴄʜᴀɴɴᴇʟᴘʟᴀʏ"
sᴇᴛᴛɪɴɢ_𝟾 : "ᴡʜᴇɴ ᴛʜɪs ᴍᴏᴅᴇ ɪs ᴇɴᴀʙʟᴇᴅ, ᴘᴇᴏᴘʟᴇ ᴡɪᴛʜᴏᴜᴛ ᴀᴅᴍɪɴ ʀɪɢʜᴛs ᴄᴀɴ ᴜsᴇ ᴀᴅᴍɪɴ ᴄᴏᴍᴍᴀɴᴅs ᴀғᴛᴇʀ ᴀ ᴄᴇʀᴛᴀɪɴ ᴀᴍᴏᴜɴᴛ ᴏғ ᴠᴏᴛᴇs."
sᴇᴛᴛɪɴɢ_𝟿 : "ᴄᴜʀʀᴇɴᴛ ᴜᴘᴠᴏᴛᴇs ʀᴇᴏ̨ᴜɪʀᴇᴅ ғᴏʀ ᴜsɪɴɢ ᴀᴅᴍɪɴ ᴄᴏᴍᴍᴀɴᴅs ᴀʀᴇ : {𝟶}"
sᴇᴛᴛɪɴɢ_𝟷𝟶 : "ᴠᴏᴛɪɴɢ ᴍᴏᴅᴇ ɪs ᴅɪsᴀʙʟᴇᴅ."
sᴇᴛᴛɪɴɢ_𝟷𝟷 : "ʟᴏᴡᴇsᴛ ᴜᴘᴠᴏᴛᴇs ᴄᴏᴜɴᴛ ᴄᴀɴ ʙᴇ 𝟸. ʏᴏᴜ ᴄᴀɴ'ᴛ sᴇᴛ ʙᴇʟᴏᴡ 𝟸"
sᴇᴛᴛɪɴɢ_𝟷𝟸 : "ʜɪɢʜᴇsᴛ ᴜᴘᴠᴏᴛᴇs ᴄᴏᴜɴᴛ ᴄᴀɴ ʙᴇ 𝟷𝟻. ʏᴏᴜ ᴄᴀɴ'ᴛ sᴇᴛ ᴀʙᴏᴠᴇ 𝟷𝟻"

