sᴇᴛ_ᴄʙ_𝟻 : "» ɢᴇᴛᴛɪɴɢ ʙᴀᴄᴋ..."

ɢsᴛᴀᴛs_𝟷 : "ɢᴇᴛᴛɪɴɢ {𝟶} sᴛᴀᴛs ᴀɴᴅ ɪɴғᴏʀᴍᴀᴛɪᴏɴ...\ɴ\ɴɪᴛ ᴍᴀʏ ᴛᴀᴋᴇ ᴀ ᴡʜɪʟᴇ, ᴘʟᴇᴀsᴇ ʜᴏʟᴅ ᴏɴ..."
ɢsᴛᴀᴛs_𝟸 : "ᴄʟɪᴄᴋ ᴏɴ ᴛʜᴇ ʙᴜᴛᴛᴏɴs ʙᴇʟᴏᴡ ᴛᴏ ᴄʜᴇᴄᴋ ᴛʜᴇ sᴛᴀᴛs ᴏғ {𝟶}."
ɢsᴛᴀᴛs_𝟹 : "<ʙ><ᴜ>{𝟶} sᴛᴀᴛs ᴀɴᴅ ɪɴғᴏʀᴍᴀᴛɪᴏɴ :</ᴜ></ʙ>\ɴ\ɴ<ʙ>ᴀssɪsᴛᴀɴᴛs :</ʙ> <ᴄᴏᴅᴇ>{𝟷}</ᴄᴏᴅᴇ>\ɴ<ʙ>ʙʟᴏᴄᴋᴇᴅ :</ʙ> <ᴄᴏᴅᴇ>{𝟸}</ᴄᴏᴅᴇ>\ɴ<ʙ>ᴄʜᴀᴛs:</ʙ> <ᴄᴏᴅᴇ>{𝟹}</ᴄᴏᴅᴇ>\ɴ<ʙ>ᴜsᴇʀs :</ʙ> <ᴄᴏᴅᴇ>{𝟺}</ᴄᴏᴅᴇ>\ɴ<ʙ>ᴍᴏᴅᴜʟᴇs :</ʙ> <ᴄᴏᴅᴇ>{𝟻}</ᴄᴏᴅᴇ>\ɴ<ʙ>sᴜᴅᴏᴇʀs :</ʙ> <ᴄᴏᴅᴇ>{𝟼}</ᴄᴏᴅᴇ>\ɴ\ɴ<ʙ>ᴀᴜᴛᴏ ʟᴇᴀᴠɪɴɢ ᴀssɪsᴛᴀɴᴛ :</ʙ> {𝟽}\ɴ<ʙ>ᴘʟᴀʏ ᴅᴜʀᴀᴛɪᴏɴ ʟɪᴍɪᴛ :</ʙ> {𝟾} ᴍɪɴᴜᴛᴇs"
ɢsᴛᴀᴛs_𝟺 : "ᴛʜɪs ʙᴜᴛᴛᴏɴ ɪs ᴏɴʟʏ ғᴏʀ sᴜᴅᴏᴇʀs."
ɢsᴛᴀᴛs_𝟻 : "<ʙ><ᴜ>{𝟶} sᴛᴀᴛs ᴀɴᴅ ɪɴғᴏʀᴍᴀᴛɪᴏɴ :</ᴜ></ʙ>\ɴ\ɴ<ʙ>ᴍᴏᴅᴜʟᴇs :</ʙ> <ᴄᴏᴅᴇ>{𝟷}</ᴄᴏᴅᴇ>\ɴ<ʙ>ᴘʟᴀᴛғᴏʀᴍ :</ʙ> <ᴄᴏᴅᴇ>{𝟸}</ᴄᴏᴅᴇ>\ɴ<ʙ>ʀᴀᴍ :</ʙ> <ᴄᴏᴅᴇ>{𝟹}</ᴄᴏᴅᴇ>\ɴ<ʙ>ᴘʜʏsɪᴄᴀʟ ᴄᴏʀᴇs :</ʙ> <ᴄᴏᴅᴇ>{𝟺}</ᴄᴏᴅᴇ>\ɴ<ʙ>ᴛᴏᴛᴀʟ ᴄᴏʀᴇs :</ʙ> <ᴄᴏᴅᴇ>{𝟻}</ᴄᴏᴅᴇ>\ɴ<ʙ>ᴄᴘᴜ ғʀᴇᴏ̨ᴜᴇɴᴄʏ :</ʙ> <ᴄᴏᴅᴇ>{𝟼}</ᴄᴏᴅᴇ>\ɴ\ɴ<ʙ>ᴘʏᴛʜᴏɴ :</ʙ> <ᴄᴏᴅᴇ>{𝟽}</ᴄᴏᴅᴇ>\ɴ<ʙ>ᴘʏʀᴏɢʀᴀᴍ :</ʙ> <ᴄᴏᴅᴇ>{𝟾}</ᴄᴏᴅᴇ>\ɴ<ʙ>ᴘʏ-ᴛɢᴄᴀʟʟs :</ʙ> <ᴄᴏᴅᴇ>{𝟿}</ᴄᴏᴅᴇ>\ɴ\ɴ<ʙ>sᴛᴏʀᴀɢᴇ ᴀᴠᴀɪʟᴀʙʟᴇ :</ʙ> <ᴄᴏᴅᴇ>{𝟷𝟶} ɢɪʙ</ᴄᴏᴅᴇ>\ɴ<ʙ>sᴛᴏʀᴀɢᴇ ᴜsᴇᴅ :</ʙ> <ᴄᴏᴅᴇ>{𝟷𝟷} ɢɪʙ</ᴄᴏᴅᴇ>\ɴ<ʙ>sᴛᴏʀᴀɢᴇ ʟᴇғᴛ :</ʙ> <ᴄᴏᴅᴇ>{𝟷𝟸} ɢɪʙ</ᴄᴏᴅᴇ>\ɴ\ɴ<ʙ>sᴇʀᴠᴇᴅ ᴄʜᴀᴛs :</ʙ> <ᴄᴏᴅᴇ>{𝟷𝟹}</ᴄᴏᴅᴇ>\ɴ<ʙ>sᴇʀᴠᴇᴅ ᴜsᴇʀs :</ʙ> <ᴄᴏᴅᴇ>{𝟷𝟺}</ᴄᴏᴅᴇ>\ɴ<ʙ>ʙʟᴏᴄᴋᴇᴅ ᴜsᴇʀs :</ʙ> <ᴄᴏᴅᴇ>{𝟷𝟻}</ᴄᴏᴅᴇ>\ɴ<ʙ>sᴜᴅᴏ ᴜsᴇʀs :</ʙ> <ᴄᴏᴅᴇ>{𝟷𝟼}</ᴄᴏᴅᴇ>\ɴ\ɴ<ʙ>ᴛᴏᴛᴀʟ ᴅʙ sɪᴢᴇ :</ʙ> <ᴄᴏᴅᴇ>{𝟷𝟽} ᴍʙ</ᴄᴏᴅᴇ>\ɴ<ʙ>ᴛᴏᴛᴀʟ ᴅʙ sᴛᴏʀᴀɢᴇ :</ʙ> <ᴄᴏᴅᴇ>{𝟷𝟾} ᴍʙ</ᴄᴏᴅᴇ>\ɴ<ʙ>ᴛᴏᴛᴀʟ ᴅʙ ᴄᴏʟʟᴇᴄᴛɪᴏɴs :</ʙ> <ᴄᴏᴅᴇ>{𝟷𝟿}</ᴄᴏᴅᴇ>\ɴ<ʙ>ᴛᴏᴛᴀʟ ᴅʙ ᴋᴇʏs :</ʙ> <ᴄᴏᴅᴇ>{𝟸𝟶}</ᴄᴏᴅᴇ>"

ᴘʟᴀʏᴄʙ_𝟷 : "» ᴀᴡᴡ, ᴛʜɪs ɪs ɴᴏᴛ ғᴏʀ ʏᴏᴜ ʙᴀʙʏ."
ᴘʟᴀʏᴄʙ_𝟸 : "» ɢᴇᴛᴛɪɴɢ ɴᴇxᴛ ʀᴇsᴜʟᴛ,\ɴ\ɴᴘʟᴇᴀsᴇ ᴡᴀɪᴛ..."

ᴄᴘʟᴀʏ_𝟷 : "» ʏᴏᴜ ᴄᴀɴ ᴘʟᴀʏ ᴍᴜsɪᴄ ɪɴ ᴄʜᴀɴɴᴇʟs ғʀᴏᴍ {𝟶} ᴛᴏ ᴀɴʏ ᴄʜᴀɴɴᴇʟ ᴏʀ ʏᴏᴜʀ ᴄʜᴀᴛ's ʟɪɴᴋᴇᴅ ᴄʜᴀɴɴᴇʟ.\ɴ\ɴ<ʙ>ғᴏʀ ʟɪɴᴋᴇᴅ ᴄʜᴀɴɴᴇʟ :</ʙ>\ɴ<ᴄᴏᴅᴇ>/ᴄʜᴀɴɴᴇʟᴘʟᴀʏ ʟɪɴᴋᴇᴅ</ᴄᴏᴅᴇ>\ɴ\ɴ<ʙ>ғᴏʀ ᴀɴʏ ᴏᴛʜᴇʀ ᴄʜᴀɴɴᴇʟ :</ʙ>\ɴ<ᴄᴏᴅᴇ>/ᴄʜᴀɴɴᴇʟᴘʟᴀʏ [ᴄʜᴀɴɴᴇʟ ɪᴅ]</ᴄᴏᴅᴇ>"
ᴄᴘʟᴀʏ_𝟸 : "» ᴛʜɪs ᴄʜᴀᴛ ᴅᴏɴ'ᴛ ʜᴀᴠᴇ ᴀɴʏ ʟɪɴᴋᴇᴅ ᴄʜᴀɴɴᴇʟ."
ᴄᴘʟᴀʏ_𝟹 : "» ᴄʜᴀɴɴᴇʟ ᴅᴇғɪɴᴇᴅ ᴛᴏ {𝟶}.\ɴᴄʜᴀɴɴᴇʟ ɪᴅ : <ᴄᴏᴅᴇ>{𝟷}</ᴄᴏᴅᴇ>"
ᴄᴘʟᴀʏ_𝟺 : "» ғᴀɪʟᴇᴅ ᴛᴏ ɢᴇᴛ ᴄʜᴀɴɴᴇʟ.\ɴ\ɴᴍᴀᴋᴇ sᴜʀᴇ ʏᴏᴜ'ᴠᴇ ᴀᴅᴅᴇᴅ ᴛʜᴇ ʙᴏᴛ ɪɴ ʏᴏᴜʀ ᴄʜᴀɴɴᴇʟ ᴀɴᴅ ᴘʀᴏᴍᴏᴛᴇᴅ ᴀs ᴀᴅᴍɪɴ."
ᴄᴘʟᴀʏ_𝟻 : "ᴏɴʟʏ ᴄʜᴀɴɴᴇʟs ᴀʀᴇ sᴜᴘᴘᴏʀᴛᴇᴅ."
ᴄᴘʟᴀʏ_𝟼 : "» ʏᴏᴜ ɴᴇᴇᴅ ᴛᴏ ʙᴇ ᴛʜᴇ <ʙ>ᴏᴡɴᴇʀ</ʙ> ᴏғ ᴛʜᴇ ᴄʜᴀɴɴᴇʟ {𝟶} ᴛᴏ ᴄᴏɴɴᴇᴄᴛ ɪᴛ ᴡɪᴛʜ ᴛʜɪs ɢʀᴏᴜᴘ.\ɴ<ʙ>ᴄʜᴀɴɴᴇʟ's ᴏᴡɴᴇʀ :</ʙ> @{𝟷}\ɴ\ɴᴀʟᴛᴇʀɴᴀᴛɪᴠᴇʟʏ ʏᴏᴜ ᴄᴀɴ ʟɪɴᴋ ʏᴏᴜʀ ɢʀᴏᴜᴘ ᴛᴏ ᴛʜᴀᴛ ᴄʜᴀɴɴᴇʟ ᴀɴᴅ ᴛʜᴇɴ ᴛʀʏ ᴄᴏɴɴɴᴇᴄᴛɪɴɢ ᴡɪᴛʜ <ᴄᴏᴅᴇ>/ᴄʜᴀɴɴᴇʟᴘʟᴀʏ ʟɪɴᴋᴇᴅ</ᴄᴏᴅᴇ>"
ᴄᴘʟᴀʏ_𝟽 : "» ᴄʜᴀɴɴᴇʟ ᴘʟᴀʏ ᴅɪsᴀʙʟᴇᴅ."

ᴘʟᴀʏ_𝟷 : "🦋"
ᴘʟᴀʏ_𝟸 : "<ʙ>➻ ᴄʜᴀɴɴᴇʟ ᴘʟᴀʏ ᴍᴏᴅᴇ</ʙ>\ɴ\ɴᴘʀᴏᴄᴇssɪɴɢ, ᴘʟᴇᴀsᴇ ᴡᴀɪᴛ...\ɴ\ɴ<ʙ>ʟɪɴᴋᴇᴅ ᴄʜᴀɴɴᴇʟ :</ʙ> {𝟶}"
ᴘʟᴀʏ_𝟹 : "» ғᴀɪʟᴇᴅ ᴛᴏ ᴘʀᴏᴄᴇss ᴏ̨ᴜᴇʀʏ."
ᴘʟᴀʏ_𝟺 : "<ʙ>ᴀᴅᴍɪɴs ᴏɴʟʏ ᴘʟᴀʏ</ʙ>\ɴᴏɴʟʏ ᴀᴅᴍɪɴs ᴏғ ᴛʜɪs ᴄʜᴀᴛ ᴀʀᴇ ᴀʟʟᴏᴡᴇᴅ ᴛᴏ ᴘʟᴀʏ\ɴ\ɴᴄʜᴀɴɢᴇ ᴘʟᴀʏ ᴍᴏᴅᴇ ᴠɪᴀ /ᴘʟᴀʏᴍᴏᴅᴇ"
ᴘʟᴀʏ_𝟻 : "» ғᴀɪʟᴇᴅ ᴛᴏ ᴘʀᴏᴄᴇss ᴀᴜᴅɪᴏ ғɪʟᴇ.\ɴ\ɴᴀᴜᴅɪᴏ ғɪʟᴇ sɪᴢᴇ ɪs ʟᴀʀɢᴇʀ ᴛʜᴀɴ ᴛʜᴇ ᴅᴇғɪɴᴇᴅ ʟɪᴍɪᴛ."
