ᴘʟᴀʏ_𝟷𝟶 : "<ʙ>ᴛɪᴛʟᴇ :</ʙ> {𝟶}\ɴ<ʙ>ᴅᴜʀᴀᴛɪᴏɴ :</ʙ> {𝟷} ᴍɪɴᴜᴛᴇs"
