ʙʟᴀᴄᴋ_𝟻 : "» ᴛʜɪs ᴄʜᴀᴛ ɪs ɴᴏᴛ ʙʟᴀᴄᴋʟɪsᴛᴇᴅ."
ʙʟᴀᴄᴋ_𝟼 : "» sᴜᴄᴄᴇssғᴜʟʟʏ ʀᴇᴍᴏᴠᴇᴅ ғʀᴏᴍ ʙʟᴀᴄᴋʟɪsᴛᴇᴅ ᴄʜᴀᴛs."
ʙʟᴀᴄᴋ_𝟽 : "» ʟɪsᴛ ᴏғ ʙʟᴀᴄᴋʟɪsᴛᴇᴅ ᴄʜᴀᴛs :\ɴ\ɴ"
ʙʟᴀᴄᴋ_𝟾 : "» ɴᴏ ʙʟᴀᴄᴋʟɪsᴛᴇᴅ ᴄʜᴀᴛs ᴏɴ {𝟶}."
ʙʟᴀᴄᴋ_𝟿 : "» sᴏᴍᴇᴛʜɪɴɢ ᴡᴇɴᴛ ᴡʀᴏɴɢ."

ᴍᴀɪɴᴛ_𝟷 : "<ʙ>ᴇxᴀᴍᴘʟᴇ :</ʙ>\ɴ/ᴍᴀɪɴᴛᴇɴᴀɴᴄᴇ [ᴇɴᴀʙʟᴇ | ᴅɪsᴀʙʟᴇ]"
ᴍᴀɪɴᴛ_𝟸 : "» {𝟶} ᴍᴀɪɴᴛᴇɴᴀɴᴄᴇ ᴍᴏᴅᴇ ᴇɴᴀʙʟᴇᴅ."
ᴍᴀɪɴᴛ_𝟹 : "» {𝟶} ᴍᴀɪɴᴛᴇɴᴀɴᴄᴇ ᴍᴏᴅᴇ ᴅɪsᴀʙʟᴇᴅ."
ᴍᴀɪɴᴛ_𝟺 : "» ᴍᴀɪɴᴛᴇɴᴀɴᴄᴇ ᴍᴏᴅᴇ ɪs ᴀʟʀᴇᴀᴅʏ ᴇɴᴀʙʟᴇᴅ."
ᴍᴀɪɴᴛ_𝟻 : "» ᴍᴀɪɴᴛᴇɴᴀɴᴄᴇ ᴍᴏᴅᴇ ɪs ᴀʟʀᴇᴀᴅʏ ᴅɪsᴀʙʟᴇᴅ."

ʟᴏɢ_𝟷 : "<ʙ>ᴇxᴀᴍᴘʟᴇ :</ʙ>\ɴ/ʟᴏɢɢᴇʀ [ᴇɴᴀʙʟᴇ | ᴅɪsᴀʙʟᴇ]"
ʟᴏɢ_𝟸 : "ᴇɴᴀʙʟᴇᴅ ʟᴏɢɢɪɴɢ."
ʟᴏɢ_𝟹 : "ᴅɪsᴀʙʟᴇᴅ ʟᴏɢɢɪɴɢ."

ʙʀᴏᴀᴅ_𝟷 : "» sᴛᴀʀᴛᴇᴅ ʙʀᴏᴀᴅᴄᴀsᴛɪɴɢ..."
ʙʀᴏᴀᴅ_𝟸 : "<ʙ>ᴇxᴀᴍᴘʟᴇ :</ʙ>\ɴ\ɴ/ʙʀᴏᴀᴅᴄᴀsᴛ [ᴍᴇssᴀɢᴇ ᴏʀ ʀᴇᴘʟʏ ᴛᴏ ᴀ ᴍᴇssᴀɢᴇ]"
ʙʀᴏᴀᴅ_𝟹 : "» ʙʀᴏᴀᴅᴄᴀsᴛᴇᴅ ᴍᴇssᴀɢᴇ ᴛᴏ {𝟶} ᴄʜᴀᴛs ᴡɪᴛʜ {𝟷} ᴘɪɴs ғʀᴏᴍ ᴛʜᴇ ʙᴏᴛ."
ʙʀᴏᴀᴅ_𝟺 : "» ʙʀᴏᴀᴅᴄᴀsᴛᴇᴅ ᴍᴇssᴀɢᴇ ᴛᴏ {𝟶} ᴜsᴇʀs."
ʙʀᴏᴀᴅ_𝟻 : "» sᴛᴀʀᴛɪɴɢ ᴀssɪsᴛᴀɴᴛ ʙʀᴏᴀᴅᴄᴀsᴛ..."
ʙʀᴏᴀᴅ_𝟼 : "➻ ᴀssɪsᴛᴀɴᴛ ʙʀᴏᴀᴅᴄᴀsᴛ :\ɴ\ɴ"
ʙʀᴏᴀᴅ_𝟽 : "↬ ᴀssɪsᴛᴀɴᴛ {𝟶} ʙʀᴏᴀᴅᴄᴀsᴛᴇᴅ ɪɴ {𝟷} ᴄʜᴀᴛs."
ʙʀᴏᴀᴅ_𝟾 : "» ᴘʟᴇᴀsᴇ ᴘʀᴏᴠɪᴅᴇ sᴏᴍᴇ ᴛᴇxᴛ ᴛᴏ ʙʀᴏᴀᴅᴄᴀsᴛ."

sᴇʀᴠᴇʀ_𝟷 : "» ғᴀɪʟᴇᴅ ᴛᴏ ɢᴇᴛ ʟᴏɢs."
sᴇʀᴠᴇʀ_𝟸 : "ᴘʟᴇᴀsᴇ ᴍᴀᴋᴇ sᴜʀᴇ ᴛʜᴀᴛ ʏᴏᴜʀ ʜᴇʀᴏᴋᴜ ᴀᴘɪ ᴋᴇʏ ᴀɴᴅ ᴀᴘᴘ ɴᴀᴍᴇ ᴀʀᴇ ᴄᴏɴғɪɢᴜʀᴇᴅ ᴄᴏʀʀᴇᴄᴛʟʏ."
sᴇʀᴠᴇʀ_𝟹 : "ᴄʜᴇᴄᴋɪɴɢ ꜰᴏʀ ᴀᴠᴀɪʟᴀʙʟᴇ ᴜᴘᴅᴀᴛᴇs..."
sᴇʀᴠᴇʀ_𝟺 : "ɢɪᴛ ᴄᴏᴍᴍᴀɴᴅ ᴇʀʀᴏʀ."
sᴇʀᴠᴇʀ_𝟻 : "ɪɴᴠᴀʟɪᴅ ɢɪᴛ ʀᴇᴘsɪᴛᴏʀʏ."
sᴇʀᴠᴇʀ_𝟼 : "» ʙᴏᴛ ɪs ᴜᴘ-ᴛᴏ-ᴅᴀᴛᴇ."
sᴇʀᴠᴇʀ_𝟽 : "» ʙᴏᴛ ᴜᴩᴅᴀᴛᴇᴅ sᴜᴄᴄᴇssғᴜʟʟʏ ! ɴᴏᴡ ᴡᴀɪᴛ ғᴏʀ ғᴇᴡ ᴍɪɴᴜᴛᴇs ᴜɴᴛɪʟ ᴛʜᴇ ʙᴏᴛ ʀᴇsᴛᴀʀᴛs ᴀɴᴅ ᴩᴜsʜ ᴄʜᴀɴɢᴇs !"
sᴇʀᴠᴇʀ_𝟾 : "{𝟶} ɪs ʀᴇsᴛᴀʀᴛɪɴɢ...\ɴ\ɴʏᴏᴜ ᴄᴀɴ sᴛᴀʀᴛ ᴩʟᴀʏɪɴɢ ᴀɢᴀɪɴ ᴀғᴛᴇʀ 𝟷𝟻-𝟸𝟶 sᴇᴄᴏɴᴅs."
sᴇʀᴠᴇʀ_𝟿 : "sᴏᴍᴇᴛʜɪɴɢ ᴡᴇɴᴛ ᴡʀᴏɴɢ, ᴩʟᴇᴀsᴇ ᴄʜᴇᴄᴋ ʟᴏɢs."
sᴇʀᴠᴇʀ_𝟷𝟶 : "ᴀɴ ᴇxᴄᴇᴩᴛɪᴏɴ ᴏᴄᴄᴜʀᴇᴅ ᴀᴛ #ᴜᴩᴅᴀᴛᴇʀ ᴅᴜᴇ ᴛᴏ : <ᴄᴏᴅᴇ>{𝟶}</ᴄᴏᴅᴇ>"
sᴇʀᴠᴇʀ_𝟷𝟷 : "» ʀᴜɴɴɪɴɢ ᴀ sᴘᴇᴇᴅᴛᴇsᴛ..."
sᴇʀᴠᴇʀ_𝟷𝟸 : "<ʙ>⇆ ʀᴜɴɴɪɴɢ ᴅᴏᴡɴʟᴏᴀᴅ sᴩᴇᴇᴅᴛᴇsᴛ...</ʙ>"
sᴇʀᴠᴇʀ_𝟷𝟹 : "<ʙ>⇆ ʀᴜɴɴɪɴɢ ᴜᴩʟᴏᴀᴅ sᴩᴇᴇᴅᴛᴇsᴛ...</ʙ>"
sᴇʀᴠᴇʀ_𝟷𝟺 : "<ʙ>↻ sʜᴀʀɪɴɢ sᴩᴇᴇᴅᴛᴇsᴛ ʀᴇsᴜʟᴛs...</ʙ>"
sᴇʀᴠᴇʀ_𝟷𝟻 : "✯ <ʙ>sᴩᴇᴇᴅᴛᴇsᴛ ʀᴇsᴜʟᴛs</ʙ> ✯\ɴ\ɴ<ᴜ><ʙ>ᴄʟɪᴇɴᴛ :</ʙ></ᴜ>\ɴ<ʙ>» ɪsᴩ :</ʙ> {𝟶}\ɴ<ʙ>» ᴄᴏᴜɴᴛʀʏ :</ʙ> {𝟷}\ɴ\ɴ<ᴜ><ʙ>sᴇʀᴠᴇʀ :</ʙ></ᴜ>\ɴ<ʙ>» ɴᴀᴍᴇ :</ʙ> {𝟸}\ɴ<ʙ>» ᴄᴏᴜɴᴛʀʏ :</ʙ> {𝟹}, {𝟺}\ɴ<ʙ>» sᴩᴏɴsᴏʀ :</ʙ> {𝟻}\ɴ<ʙ>» ʟᴀᴛᴇɴᴄʏ :</ʙ> {𝟼}\ɴ<ʙ>» ᴩɪɴɢ :</ʙ> {𝟽}"

ɢʙᴀɴ_𝟷 : "» ᴡʜʏ ᴅɪᴅ ʏᴏᴜ ᴡᴀɴɴᴀ ɢʙᴀɴ ʏᴏᴜʀsᴇʟғ ʙᴀʙʏ ?"
ɢʙᴀɴ_𝟸 : "» ᴡʜʏ sʜᴏᴜʟᴅ ɪ ɢʙᴀɴ ᴍʏsᴇʟғ ?"
ɢʙᴀɴ_𝟹 : "» ʏᴏᴜ ᴄᴀɴ'ᴛ ɢʙᴀɴ ᴍʏ sᴜᴅᴏᴇʀs."
ɢʙᴀɴ_𝟺 : "» {𝟶} ɪs ᴀʟʀᴇᴀᴅʏ ɢʟᴏʙᴀʟʟʏ ʙᴀɴɴᴇᴅ ғʀᴏᴍ ᴛʜᴇ ʙᴏᴛ."
ɢʙᴀɴ_𝟻 : "» ɪɴɪᴛɪᴀʟɪᴢɪɴɢ ɢʟᴏʙᴀʟ ʙᴀɴ ᴏɴ {𝟶}.\ɴ\ɴ<ʙ>ᴛɪᴍᴇ ᴇxᴘᴇᴄᴛᴇᴅ :</ʙ> {𝟷}"
ɢʙᴀɴ_𝟼 : "<ʙ><ᴜ>ɴᴇᴡ ɢʟᴏʙᴀʟ ʙᴀɴ ᴏɴ {𝟶} :</ᴜ></ʙ>\ɴ\ɴ<ʙ>ᴏʀɪɢɪɴᴀᴛᴇᴅ ғʀᴏᴍ :</ʙ> {𝟷} [<ᴄᴏᴅᴇ>{𝟸}</ᴄᴏᴅᴇ>]\ɴ<ʙ>ᴜsᴇʀ :</ʙ> {𝟹}\ɴ<ʙ>ᴜsᴇʀ ɪᴅ :</ʙ> {𝟺}\ɴ\ɴ<ʙ>ʙᴀɴɴᴇᴅ ʙʏ :</ʙ> {𝟻}\ɴ<ʙ>ᴄʜᴀᴛs :</ʙ> </ᴄᴏᴅᴇ>{𝟼}</ᴄᴏᴅᴇ>"
ɢʙᴀɴ_𝟽 : "» {𝟶} ɪs ɴᴏᴛ ɢʙᴀɴɴᴇᴅ ғʀᴏᴍ ᴛʜᴇ ʙᴏᴛ."
ɢʙᴀɴ_𝟾 : "» ʟɪғᴛɪɴɢ ɢʟᴏʙᴀʟ ʙᴀɴ ғʀᴏᴍ {𝟶}.\ɴ\ɴ<ʙ>ᴇxᴘᴇᴄᴛᴇᴅ ᴛɪᴍᴇ :</ʙ> {𝟷}"
ɢʙᴀɴ_𝟿 : "» ʟɪғᴛᴇᴅ ɢʟᴏʙᴀʟ ʙᴀɴ ғʀᴏᴍ {𝟶}.\ɴ\ɴᴜɴʙᴀɴɴᴇᴅ ɪɴ {𝟷} ᴄʜᴀᴛs."
ɢʙᴀɴ_𝟷𝟶 : "» ɴᴏ ᴏɴᴇ ɪs ɢʟᴏʙᴀʟʟʏ ʙᴀɴɴᴇᴅ ғʀᴏᴍ ᴛʜᴇ ʙᴏᴛ."
ɢʙᴀɴ_𝟷𝟷 : "» ғᴇᴛᴄʜɪɴɢ ɢʙᴀɴɴᴇᴅ ᴜsᴇʀs ʟɪsᴛ..."
ɢʙᴀɴ_𝟷𝟸 : "🙂 <ʙ>ɢʟᴏʙᴀʟʟʏ ʙᴀɴɴᴇᴅ ᴜsᴇʀs :</ʙ>\ɴ\ɴ"

